import "./TodoCounter.css";

function TodoCounter({ completed, total }) {
  return (
    <h1 className="TodoCounter">
      {completed < total
        ? (
          <span>
            Has completado <span style={{ fontWeight: 'bold' }}>{completed}</span> de {total} TODOs
          </span>
        )
        : 'Has completado todos los TODOs'}
    </h1>
  );
}

export { TodoCounter };
